eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   book1Explanations: () => (/* binding */ book1Explanations)\n/* harmony export */ });\nconst book1Explanations = {\n    6: `এই পৃষ্ঠাটি হলো 'প্রথম অধ্যায়: জীবন পাঠ'-এর শুরু। এখানে মানবসভ্যতার বিকাশে জীববিজ্ঞানের গুরুত্ব সম্পর্কে সংক্ষিপ্ত আলোচনা করা হয়েছে। জানানো হয়েছে যে খাদ্য উৎপাদন, চিকিৎসা এবং পরিবেশ রক্ষায় জীববিজ্ঞানের ভূমিকা অপরিহার্য। এই অধ্যায়ে জীববিজ্ঞানের সংজ্ঞা, প্রধান শাখা এবং জীবের নামকরণের পদ্ধতি নিয়ে আলোচনা করা হবে।`,\n    7: `এই পৃষ্ঠাটি প্রথম অধ্যায়ের শিক্ষণীয় উদ্দেশ্যগুলো তুলে ধরেছে। এই অধ্যায়টি শেষে শিক্ষার্থীরা জীববিজ্ঞানের ধারণা ব্যাখ্যা করতে, এর প্রধান শাখাসমূহ বর্ণনা করতে, জীবের শ্রেণিবিন্যাসের ধারণা, প্রয়োজনীয়তা ও পদ্ধতি বর্ণনা করতে এবং নামকরণের গুরুত্ব সম্পর্কে জানতে পারবে। এছাড়া, বাস্তবজীবনে জীবের শ্রেণিবিন্যাসের উপযোগিতা সম্পর্কে সচেতন হবে।`,\n    8: `এই পৃষ্ঠায় ১.১ জীববিজ্ঞানের ধারণা এবং ১.২ জীববিজ্ঞানের শাখাসমূহ নিয়ে আলোচনা শুরু হয়েছে।\n• ১.১ জীববিজ্ঞানের ধারণা: এখানে বলা হয়েছে যে জীববিজ্ঞান হলো প্রকৃতির একটি বিশেষ বিজ্ঞান, যা জীবের জীবন ও জীবসত্তা নিয়ে আলোচনা করে। এটি ভৌতবিজ্ঞান ও রসায়নের নিয়ম মেনে চলে। 'Biology' শব্দটি গ্রিক শব্দ 'Bios' (জীবন) এবং 'Logos' (জ্ঞান/আলোচনা) থেকে এসেছে। কৃষি, শিল্প ও চিকিৎসায় এর গুরুত্বপূর্ণ ভূমিকা রয়েছে।\n• ১.২ জীববিজ্ঞানের শাখাসমূহ: জীবের আলোচনার সুবিধার জন্য জীববিজ্ঞানকে প্রধানত ভৌত জীববিজ্ঞান ও ফলিত জীববিজ্ঞান—এই দুই ভাগে ভাগ করা হয়েছে।`,\n    9: `এই পৃষ্ঠায় ১.২.১ ভৌত জীববিজ্ঞান (Fundamental Biology)-এর আলোচনা শুরু হয়েছে। এখানে ভৌত জীববিজ্ঞানের ১১টি প্রধান শাখা সম্পর্কে বর্ণনা করা হয়েছে:\n• (a) অঙ্গসংস্থান (Morphology): জীবের দৈহিক গঠন ও অঙ্গ-প্রত্যঙ্গের বর্ণনা।\n• (b) শ্রেণিবিন্যাসবিদ্যা (Taxonomy): জীবের শ্রেণিবিন্যাস ও রীতিনীতি।\n• (c) শারীরবিদ্যা (Physiology): জীবদেহের কার্যপ্রণালী ও রাসায়নিক কার্যাবলী।\n• (d) হিস্টোলজি (Histology): জীবদেহের টিস্যু বা কলার গঠন।\n• (e) ভ্রূণবিদ্যা (Embryology): জনন কোষের উৎপত্তি, ভ্রূণের গঠন ও বিকাশ।\n• (f) কোষবিদ্যা (Cytology): কোষের গঠন, কার্য ও বিভাজন।\n• (g) বংশগতিবিদ্যা বা জেনেটিক্স (Genetics): জিন ও বংশগতি সম্পর্কিত আলোচনা।\n• (h) বিবর্তন (Evolution): পৃথিবীর প্রাণের বিকাশ ও জীবের ক্রমবিকাশ।\n• (i) বাস্তুবিদ্যা (Ecology): প্রাকৃতিক পরিবেশের সাথে জীবের সম্পর্ক।\n• (j) এন্ডোক্রাইনোলজি (Endocrinology): জীবদেহে হরমোনের কার্যাবলী।\n• (k) জীবভূগোল (Biogeography): পৃথিবীর বিভিন্ন অঞ্চলে জীবের বিস্তৃতি।`,\n    10: `এই পৃষ্ঠায় ১.২.২ ফলিত জীববিজ্ঞান (Applied Biology)-এর আলোচনা দেওয়া হয়েছে। এই শাখায় জীবন-সংশ্লিষ্ট ব্যবহারিক বিষয়গুলো আলোচনা করা হয়। এখানে ফলিত জীববিজ্ঞানের ১৭টি শাখা সম্পর্কে বর্ণনা করা হয়েছে:\n• (a) জীবাশ্মবিজ্ঞান (Palaeontology): প্রাগৈতিহাসিক জীবের বিবরণ।\n• (b) জীবপরিসংখ্যানবিদ্যা (Biostatistics): জীব সংক্রান্ত পরিসংখ্যান।\n• (c) পরজীবীবিদ্যা (Parasitology): পরজীবী ও পরজীবী জীবের জীবনপ্রণালী।\n• (d) মৎস্যবিজ্ঞান (Fisheries): মাছ, মৎস্য সম্পদ ও সংরক্ষণ।\n• (e) কীটতত্ত্ব (Entomology): কীটপতঙ্গের জীবন, উপকারিতা ও ক্ষয়ক্ষতি।\n• (f) অণুজীববিজ্ঞান (Microbiology): ভাইরাস, ব্যাকটেরিয়া ইত্যাদি অণুজীব।\n• (g) কৃষিবিজ্ঞান (Agriculture): কৃষিকর্মের বিজ্ঞান।\n• (h) চিকিৎসাবিজ্ঞান (Medical Science): মানবদেহ, রোগ ও চিকিৎসা।\n• (i) জিনপ্রকৌশল (Genetic Engineering): জিনগত পরিবর্তন ও এর ব্যবহার।\n• (j) প্রাণরসায়ন (Biochemistry): জীবের রাসায়নিক কার্যাবলী।\n• (k) পরিবেশবিজ্ঞান (Environmental Science): পরিবেশ সংক্রান্ত বিজ্ঞান।\n• (l) সামুদ্রিক জীববিজ্ঞান (Marine Biology): সামুদ্রিক জীব।\n• (m) বনবিদ্যা (Forestry): বন ও বনজ সম্পদ ব্যবস্থাপনা।\n• (n) জীবপ্রযুক্তি (Biotechnology): জীব ব্যবহার করে মানবকল্যাণ।\n• (o) ফার্মেসি (Pharmacy): ঔষধশিল্প ও প্রযুক্তি।\n• (p) বন্যপ্রাণিবিদ্যা (Wildlife): বন্যপ্রাণী বিষয়ক বিজ্ঞান।\n• (q) বায়োইনফরমেটিক্স (Bioinformatics): কম্পিউটার নির্ভর জীববিজ্ঞানের তথ্য বিশ্লেষণ।`,\n    11: `এই পৃষ্ঠায় দুটি একক কাজ দেওয়া হয়েছে। প্রথম কাজে শিক্ষার্থীরা চিত্র থেকে জীবের বিভিন্ন শাখা চিহ্নিত করবে। দ্বিতীয় কাজে দৈনিক পত্রিকা বা সাময়িকী থেকে জীববিজ্ঞানের শাখা সম্পর্কিত খবর খুঁজে বের করে ভৌত ও ফলিত শাখার তালিকা তৈরি করবে। এরপর ১.৩ জীবের শ্রেণিবিন্যাস শীর্ষক নতুন আলোচনার সূচনা করা হয়েছে, যেখানে বলা হয়েছে যে জানা ও শেখার সুবিধার জন্য অসংখ্য জীবকে শ্রেণিবিন্যাস করার প্রয়োজন।`,\n    12: `এই পৃষ্ঠায় ১.৩ জীবের শ্রেণিবিন্যাস নিয়ে আলোচনা করা হয়েছে।\n• শ্রেণিবিন্যাস: ধারণা ও উদ্দেশ্য: বলা হয়েছে যে সুনির্দিষ্ট নিয়মে জীবকে বিন্যস্ত করার প্রক্রিয়া হলো শ্রেণিবিন্যাস বা ট্যাক্সোনমি। এর জনক হলেন সুইডিশ প্রকৃতিবিদ ক্যারোলাস লিনিয়াস (১৭০৭-১৭৭৮)। শ্রেণিবিন্যাসের মূল লক্ষ্য হলো জীবকে সহজে জানা, তাদের সম্পর্ক নির্ণয় ও সংরক্ষণে সচেতন হওয়া।\n• জীবজগৎ: পূর্বে জীবকে উদ্ভিদ ও প্রাণী - এই দুই জগতে বিবেচনা করা হলেও, বর্তমানে কোষের বৈশিষ্ট্য, সংখ্যা ও খাদ্যের ওপর ভিত্তি করে আর. এইচ. হুইটেকার ১৯৭৯ সালে জীবজগৎকে পাঁচটি রাজ্য (Kingdom) বা ফাইভ কিংডমে ভাগ করার প্রস্তাব করেন। পৃষ্ঠাটিতে এই পাঁচ রাজ্যকে একটি ফ্লো-চার্টেও দেখানো হয়েছে।`,\n    13: `এই পৃষ্ঠায় আর. এইচ. হুইটেকার প্রদত্ত শ্রেণিবিন্যাস পদ্ধতির বিস্তারিত বর্ণনা দেওয়া হয়েছে, যা পরে মারগুলিস (১৯৭৪ সালে) আরও পরিবর্তিত করেন।\n• সুপার কিংডম ১: প্রোকারিয়োটা (Prokaryotae): এ রাজ্যের জীবরা হলো আদিকোষী (নিউক্লিয়াস সুগঠিত নয়)।\n  ◦ রাজ্য ১: মনেরা (Monera): এদের বৈশিষ্ট্য হলো এককোষী, ফিলামেন্টাস, কোষপ্রাচীর আছে কিন্তু প্লাস্টিড, মাইটোকন্ড্রিয়া ইত্যাদি নেই। উদাহরণ: নীলাভ সবুজ শৈবাল, ব্যাকটেরিয়া।\n• সুপার কিংডম ২: ইউক্যারিওটা (Eukaryota): এ রাজ্যের জীবরা হলো সুগঠিত নিউক্লিয়াসযুক্ত এককোষী বা বহুকোষী।\n  ◦ রাজ্য ২: প্রোটিস্টা (Protista): এদের বৈশিষ্ট্য হলো এককোষী বা বহুকোষী, সুগঠিত নিউক্লিয়াস ও ক্রোমোজোম আছে। এরা এককভাবে বা কলোনি আকারে থাকতে পারে। উদাহরণ: অ্যামিবা, ডায়াটম।`,\n    14: `এই পৃষ্ঠায় বাকি তিনটি রাজ্য নিয়ে আলোচনা করা হয়েছে।\n• রাজ্য ৩: ফাঞ্জাই (Fungi): এদের বৈশিষ্ট্য হলো অধিকাংশই স্থলজ, মৃতজীবী বা পরজীবী। এদের দেহে ক্লোরোফিল থাকে না, কোষপ্রাচীর কাইটিন দিয়ে গঠিত। উদাহরণ: ঈস্ট, পেনিসিলিয়াম, মাশরুম।\n• রাজ্য ৪: প্লান্টি (Plantae): এরা প্রকৃত নিউক্লিয়াসযুক্ত এবং সালোকসংশ্লেষণকারী উদ্ভিদ। এদের দেহে উন্নত টিস্যুতন্ত্র ও ভ্রূণ সৃষ্টি হয়। এরা অ্যানাইসোগ্যামাস যৌন জনন সম্পন্ন করে। উদাহরণ: সবুজ উদ্ভিদ। এই রাজ্যের শ্রেণিবিন্যাসকে একটি ফ্লো-চার্ট আকারে দেখানো হয়েছে (যেমন: ব্রায়োফাইটা, ট্রাকিওফাইটা ইত্যাদি)।`,\n    15: `এই পৃষ্ঠায় সর্বশেষ রাজ্য ও শ্রেণিবিন্যাসের বিভিন্ন ধাপ নিয়ে আলোচনা করা হয়েছে।\n• রাজ্য ৫: অ্যানিম্যালিয়া (Animalia): এরা বহুকোষী, সুগঠিত নিউক্লিয়াসযুক্ত ও স্বভোজী নয়, এদের কোষে কোষপ্রাচীর, প্লাস্টিড ও কোষগহ্বর নেই। এরা জটিল টিস্যুতন্ত্র ও প্রত্যঙ্গ নিয়ে গঠিত। উদাহরণ: রয়েল বেঙ্গল টাইগার। এই অংশে টমাস ক্যাভালিয়ার-স্মিথের (২০০৪) জীবজগৎকে ৬টি রাজ্যে বিভক্ত করার কথাও উল্লেখ করা হয়েছে।\n• ১.৪ শ্রেণিবিন্যাসের বিভিন্ন ধাপ: এখানে শ্রেণিবিন্যাসের ধাপ বা টেক্সন সম্পর্কে বলা হয়েছে। জীবের শ্রেণিবিন্যাসে মূল সাতটি আন্তর্জাতিক ধাপ আছে, যেখানে একটি জীব প্রজাতি হিসেবে বিন্যস্ত হয়। ধাপগুলো হলো: রাজ্য (Kingdom), পর্ব/বিভাগ (Phylum/Division), শ্রেণি (Class), বর্গ (Order), গোত্র (Family), গণ (Genus), প্রজাতি (Species)।`,\n    16: `এই পৃষ্ঠায় পূর্ববর্তী অধ্যায়ের ধারাবাহিকতায় মানুষের (Homo sapiens) শ্রেণিবিন্যাসকে উদাহরণ হিসেবে তুলে ধরা হয়েছে। এখানে শ্রেণিবিন্যাসের বিভিন্ন ধাপ বা নেস্টেড হায়ারার্কি (nested hierarchy) যেমন—রাজ্য (Kingdom), পর্ব (Phylum), শ্রেণি (Class), বর্গ (Order), গোত্র (Family), গণ (Genus) এবং প্রজাতি (Species)-এর নাম ও প্রধান বৈশিষ্ট্য সংক্ষেপে বর্ণনা করা হয়েছে। এটি দেখায় কীভাবে বৈজ্ঞানিক পদ্ধতিতে একটি জীবকে সুনির্দিষ্ট অবস্থানে রাখা হয়।`,\n    17: `এই পৃষ্ঠায় ১.৫ দ্বিপদ নামকরণ পদ্ধতি (Binomial Nomenclature) নিয়ে আলোচনা করা হয়েছে।\n• ধারণা: দ্বিপদ নামকরণ হলো জীবের বৈজ্ঞানিক নাম দেওয়ার একটি পদ্ধতি, যেখানে দুটি পদ ব্যবহার করা হয়—প্রথমটি গণ (Genus) এবং দ্বিতীয়টি প্রজাতি (Species)। এই পদ্ধতি ক্যারোলাস লিনিয়াস প্রথম ভালোভাবে প্রবর্তন করেন।\n• নিয়মাবলী: আন্তর্জাতিক নিয়মানুযায়ী (উদ্ভিদের জন্য ICBN এবং প্রাণীর জন্য ICZN), বৈজ্ঞানিক নাম ল্যাটিন ভাষায় হবে। নামের প্রথম অংশ (গণ) বড় অক্ষর দিয়ে এবং দ্বিতীয় অংশ (প্রজাতি) ছোট অক্ষর দিয়ে লিখতে হবে। লেখার সময় গণ ও প্রজাতির নামের নিচে আলাদাভাবে দাগ দিতে হবে অথবা ইটালিক অক্ষরে লিখতে হবে।`,\n    18: `এই পৃষ্ঠায় দ্বিপদ নামকরণের বাকি নিয়মাবলী ও কয়েকটি পরিচিত জীবের বৈজ্ঞানিক নামের তালিকা দেওয়া হয়েছে।\n• নিয়মাবলী (continuation): বৈজ্ঞানিক নাম মুদ্রণের সময় ইটালিক অক্ষরে লিখতে হবে। লেখার সময় গণ ও প্রজাতির নিচে আলাদাভাবে দাগ দিতে হবে। যিনি প্রথম বৈজ্ঞানিক নাম দেন, তার নাম সংক্ষেপে নামের শেষে উল্লেখ করা যায় (যেমন: L.)।\n• দ্বিপদ নামের তালিকা: এখানে ধান, পাট, আম, কাঁঠাল, জবা, কলেরা জীবাণু, ম্যালেরিয়া জীবাণু, তেলাপোকা, মৌমাছি, ইলিশ, কুনো ব্যাঙ, দোয়েল, রয়েল বেঙ্গল টাইগার ও মানুষের (Homo sapiens) সাধারণ নাম এবং তার বৈজ্ঞানিক নাম দেওয়া হয়েছে।`,\n    19: `এই পৃষ্ঠায় প্রথম অধ্যায়ের অনুশীলনী (Exercise) শুরু হয়েছে। শুরুতে একটি একক কাজ দেওয়া হয়েছে, যেখানে একজন শিক্ষার্থীকে নতুন আবিষ্কৃত একটি ফড়িংয়ের দ্বিপদ নামকরণ করে তার যৌক্তিকতা ব্যাখ্যা করতে বলা হয়েছে। এরপর সংক্ষিপ্ত উত্তর প্রশ্ন ও রচনামূলক প্রশ্ন অংশে জীববিজ্ঞানের গুরুত্ব, শাখা, দ্বিপদ নামকরণ ও শ্রেণিবিন্যাসের প্রয়োজনীয়তা সম্পর্কিত ৫টি প্রশ্ন দেওয়া হয়েছে।`,\n    20: `এই পৃষ্ঠায় প্রথম অধ্যায়ের বহুনির্বাচনি প্রশ্ন (Multiple Choice Questions) দেওয়া হয়েছে। এখানে কীটতত্ত্ব, শ্রেণিবিন্যাসের উদ্দেশ্য এবং একটি ব্যাকটেরিয়ার চিত্রের ভিত্তিতে তার নাম ও বৈশিষ্ট্য সম্পর্কিত ৪টি প্রশ্ন দেওয়া হয়েছে। প্রশ্নগুলো জীববিজ্ঞানের শাখা, শ্রেণিবিন্যাস এবং মনেরা রাজ্যের জীব সম্পর্কিত ধারণা যাচাই করে।`,\n    21: `এই পৃষ্ঠায় প্রথম অধ্যায়ের সৃজনশীল প্রশ্ন (Creative Question) দেওয়া হয়েছে। চিত্রে একটি ছত্রাক (চিত্র-১) এবং একটি চারাগাছ (চিত্র-২) দেখানো হয়েছে। ক, খ, গ, ঘ—এই চারটি ভাগে শ্রেণিবিন্যাস ও জীবের বৈশিষ্ট্য সম্পর্কিত বিশ্লেষণধর্মী প্রশ্ন করা হয়েছে, যেমন: শ্রেণিবিন্যাসের একক কী, বংশগতিবিদ্যা কেন ভৌত শাখা, চিত্র-২ এর নামকরণের ধারাবাহিকতা এবং চিত্র দুটির মধ্যে কোন জীবটি অধিক উন্নত তা কারণসহ ব্যাখ্যা করা।`,\n    22: `এই পৃষ্ঠাটি দ্বিতীয় অধ্যায়: জীবকোষ ও টিস্যু-এর সূচনা। এখানে পূর্বের শ্রেণির জ্ঞানের ওপর ভিত্তি করে জীবকোষ সম্পর্কে আরও বিস্তারিত জানার কথা বলা হয়েছে। একটি সাধারণ অণুবীক্ষণ যন্ত্রে দেখা কোষ এবং ইলেকট্রন অণুবীক্ষণ যন্ত্রে দেখা কোষের গঠনের ভিন্নতা নিয়ে একটি প্রশ্ন উত্থাপন করা হয়েছে, যার উত্তর এই অধ্যায়ে পাওয়া যাবে। পৃষ্ঠাটির ছবিতে ব্যাকটেরিয়ার মতো দেখতে কক্কাস আকৃতির কিছু কোষ দেখানো হয়েছে।`,\n    23: `এই পৃষ্ঠায় দ্বিতীয় অধ্যায়ের শিক্ষণীয় উদ্দেশ্যগুলো দেওয়া হয়েছে। এই অধ্যায়টি শেষে শিক্ষার্থীরা উদ্ভিদ ও প্রাণিকোষের প্রধান অঙ্গাণু ও তাদের কাজ ব্যাখ্যা করতে, কোষের উপযোগিতা মূল্যায়ন করতে, উদ্ভিদ ও প্রাণী টিস্যুর ব্যাখ্যা দিতে, কোষ, অঙ্গ ও তন্ত্রের ধারণা ব্যাখ্যা করতে, অণুবীক্ষণ যন্ত্রের সাহায্যে কোষ পর্যবেক্ষণ করতে, টিস্যুতন্ত্রের কাজ ব্যাখ্যা করতে এবং জীবদেহে নানা কার্যক্রমের কোষেদের অবদান অনুধাবন করতে সক্ষম হবে।`,\n    24: `এই পৃষ্ঠায় ২.১ জীবকোষ নিয়ে আলোচনা করা হয়েছে।\n• জীবকোষের সংজ্ঞা: এটি হলো জীবদেহের গঠন ও কার্যক্রিয়ার একক। বিজ্ঞানী লোয়ি (Loewy) এবং সিকিভিজ (Siekevitz) জীবকোষকে সজীব ঝিল্লি (selectively permeable) দিয়ে আবৃত এবং জীবক্রিয়াকলাপের একক বা অন্য সজীব মাধ্যম ছাড়াই নিজের প্রতিলিপি তৈরি করতে সক্ষম সত্ত্বা বলেছেন।\n• কোষের প্রকারভেদ: নিউক্লিয়াসের গঠনের ভিত্তিতে কোষ দুই প্রকার: (ক) আদিকোষ বা প্রাককেন্দ্রিক কোষ (Prokaryotic cell)—এতে সুগঠিত নিউক্লিয়াস থাকে না (যেমন: নীলাভ সবুজ শৈবাল, ব্যাকটেরিয়া)। (খ) প্রকৃত কোষ বা সুকেন্দ্রিক কোষ (Eukaryotic cell)—এতে সুগঠিত নিউক্লিয়াস থাকে (যেমন: অধিকাংশ জীবকোষ)।\n• প্রকৃত কোষের প্রকারভেদ: কাজের ভিত্তিতে প্রকৃত কোষ দুই ধরনের: দেহকোষ (Somatic cell) এবং জনকোষ (Gametic cell)।`,\n    25: `এই পৃষ্ঠায় ২.২ উদ্ভিদ ও প্রাণিকোষের প্রধান অঙ্গাণু ও তাদের কাজ নিয়ে আলোচনা শুরু হয়েছে।\n• জাইগোট: পুং ও স্ত্রী জননকোষের মিলনের ফলে সৃষ্ট প্রথম কোষকে জাইগোট (Zygote) বলে, যা বারবার বিভাজনের মাধ্যমে জীবদেহ গঠন করে।\n• কোষের অঙ্গাণুসমূহ: এই অংশে উচ্চশ্রেণির উদ্ভিদ ও প্রাণীর প্রকৃত কোষের প্রধান প্রধান অঙ্গাণু এবং তাদের অবস্থানকে দুটি আলাদা চিত্র (চিত্র ২.০১ ও চিত্র ২.০২)-এর মাধ্যমে চিহ্নিত করে দেখানো হয়েছে, যেমন: কোষপ্রাচীর, কোষগহ্বর, নিউক্লিয়াস, মাইটোকন্ড্রিয়া, ক্লোরোপ্লাস্ট, গলজি বস্তু, সেন্ট্রোসোম ইত্যাদি।`,\n    26: `এই পৃষ্ঠায় কোষের গুরুত্বপূর্ণ অঙ্গাণু কোষপ্রাচীর (Cell Wall) ও প্রোটোপ্লাজম (Protoplasm) সম্পর্কে আলোচনা করা হয়েছে।\n• কোষপ্রাচীর: এটি উদ্ভিদকোষের একটি অনন্য এবং জড় বহিরাবরণ যা সেলুলোজ দিয়ে তৈরি। এটি কোষকে দৃঢ়তা প্রদান করে, আকার ও আকৃতি বজায় রাখে এবং ভেতরের অঙ্গাণুকে সুরক্ষা দেয়। এটি প্রাণী কোষে থাকে না।\n• প্রোটোপ্লাজম: এটি কোষের ভেতরের সজীব, আঠালো জেলির মতো বস্তু, যা কোষঝিল্লি দ্বারা আবৃত থাকে। প্রোটোপ্লাজমকে প্রধানত সাইটোপ্লাজম (নিউক্লিয়াস বাদে) ও নিউক্লিয়াস—এই দুটি ভাগে ভাগ করা হয়।`,\n    27: `এই পৃষ্ঠায় কোষের অভ্যন্তরের আরও দুটি গুরুত্বপূর্ণ অংশ নিয়ে আলোচনা করা হয়েছে: কোষঝিল্লি (Plasmalemma) এবং সাইটোপ্লাজমীয় অঙ্গাণু (Cytoplasmic organelles)।\n• কোষঝিল্লি: এটিকে প্লাজমা মেমব্রেনও বলা হয়। এটি কোষের সাইটোপ্লাজমের বাইরে থাকা দ্বিস্তরবিশিষ্ট স্থিতিস্থাপক পর্দা, যা প্রধানত লিপিড ও প্রোটিন দিয়ে তৈরি। এটি একটি অর্ধভেদ্য পর্দা হিসেবে কাজ করে, যা পানি ও খনিজ লবণ চলাচল নিয়ন্ত্রণ করে।\n• সাইটোপ্লাজমীয় অঙ্গাণু: সাইটোপ্লাজমের মধ্যে ভাসমান বিভিন্ন সজীব ও জড় বস্তুকে সাইটোপ্লাজমীয় অঙ্গাণু বলে। এর মধ্যে প্রথম আলোচিত অঙ্গাণু হলো মাইটোকন্ড্রিয়া (Mitochondria)। এটি শ্বসনের সাথে সম্পর্কিত এবং চারটি ধাপে (গ্লাইকোলাইসিস, অ্যাসিটাইল কো-এ সৃষ্টি, ক্রেবস চক্র ও ইলেকট্রন প্রবাহ তন্ত্র) শক্তি উৎপাদন করে।`,\n    28: `এই পৃষ্ঠায় মাইটোকন্ড্রিয়া এবং প্লাস্টিড (Plastid) নিয়ে বিস্তারিত আলোচনা করা হয়েছে।\n• মাইটোকন্ড্রিয়া: এটি দ্বিতীয়, তৃতীয় ও চতুর্থ ধাপে শ্বসনের জন্য অত্যন্ত গুরুত্বপূর্ণ। এই অঙ্গাণুটি কোষে সবচেয়ে বেশি শক্তি (ATP) উৎপাদন করে, তাই একে 'কোষের শক্তিকেন্দ্র' বা 'পাওয়ার হাউজ' বলা হয়। এটি প্রায় সকল সুকেন্দ্রিক কোষে পাওয়া যায়।\n• প্লাস্টিড: এটি উদ্ভিদ কোষের একটি অন্যতম বৈশিষ্ট্য। এর প্রধান কাজ খাদ্য প্রস্তুত ও সঞ্চয় করা। এটি তিন ধরনের: ক্লোরোপ্লাস্ট, ক্রোমোফ্লাস্ট এবং লিউকোপ্লাস্ট।\n   ◦ (i) ক্লোরোপ্লাস্ট (Chloroplast): এটি সবুজ রঙের প্লাস্টিড যা সালোকসংশ্লেষণের মাধ্যমে আলোক শক্তিকে রাসায়নিক শক্তিতে রূপান্তর করে।`,\n    29: `এই পৃষ্ঠায় ক্রোমোফ্লাস্ট (Chromoplast) এবং লিউকোপ্লাস্ট (Leucoplast) নিয়ে আলোচনা শেষ করা হয়েছে এবং একটি একক কাজ দেওয়া হয়েছে।\n• (ii) ক্রোমোফ্লাস্ট: এগুলো রঙিন প্লাস্টিড তবে সবুজ নয়। এতে হলুদ (জ্যান্থোফিল), কমলা (ক্যারোটিন) বা লাল (ফাইকোএরিথ্রিন) রঙের রঞ্জক পদার্থ থাকে। এদের প্রধান কাজ হলো ফুল, পাতা ও অন্যান্য অঙ্গকে আকর্ষণীয় করা এবং পরাগসংযোগে সাহায্য করা।\n• (iii) লিউকোপ্লাস্ট: এগুলো বর্ণহীন প্লাস্টিড। এদের প্রধান কাজ খাদ্য সঞ্চয় করা। সাধারণত মূল বা ভূ-গর্ভস্থ কাণ্ডে এদের দেখা যায়। আলোকের সংস্পর্শে এলে লিউকোপ্লাস্ট ক্লোরোপ্লাস্টে রূপান্তরিত হতে পারে।\n• একক কাজ: তিন ধরনের প্লাস্টিডের চিত্র এঁকে শ্রেণিতে প্রদর্শন করতে বলা হয়েছে।`,\n    30: `এই পৃষ্ঠায় বাকি তিনটি গুরুত্বপূর্ণ সাইটোপ্লাজমীয় অঙ্গাণু—গলজি বস্তু (Golgi body), এন্ডোপ্লাজমিক রেটিকুলাম (Endoplasmic reticulum), কোষগহ্বর (Vacuole) এবং লাইসোসোম (Lysosome) নিয়ে আলোচনা করা হয়েছে।\n• গলজি বস্তু: এটি প্রধানত প্রাণীকোষে পাওয়া যায়। এটি উৎসেচক, হরমোন নিঃসরণ এবং প্রোটিন সঞ্চয়ে সাহায্য করে।\n• এন্ডোপ্লাজমিক রেটিকুলাম: এটি নালিকার মতো জালিকা, যার গায়ে রাইবোসোম থাকলে অমসৃণ এবং না থাকলে মসৃণ হয়। এর প্রধান কাজ প্রোটিন, লিপিড ও অন্যান্য বস্তুর সংশ্লেষণ ও পরিবহনে সহায়তা করা।\n• কোষগহ্বর: এটি সাইটোপ্লাজমের ভেতরের ফাঁকা স্থান, যা কোষরস ধারণ করে। উদ্ভিদকোষে এটি অনেক বড় হয়, প্রাণীকোষে সাধারণত থাকে না বা থাকলেও খুব ছোট হয়।\n• লাইসোসোম: এটি জীবাণু থেকে কোষকে রক্ষা করে। এটি পরিপাককারী উৎসেচক দিয়ে পূর্ণ থাকে।`,\n    31: `এই পৃষ্ঠায় কোষের বাকি অঙ্গাণু, যেমন কোষ কঙ্কাল (Cytoskeleton), রাইবোসোম (Ribosome) ও সেন্ট্রোসোম (Centrosome)-এর বর্ণনা দেওয়া হয়েছে এবং নিউক্লিয়াস (Nucleus) আলোচনার সূচনা হয়েছে।\n• কোষ কঙ্কাল: এটি কোষের ভেতরে জালিকার মতো একটি কাঠামো, যা কোষকে দৃঢ়তা ও আকৃতি দেয়।\n• রাইবোসোম: এটি ঝিল্লিবিহীন অঙ্গাণু, যা প্রোটিন সংশ্লেষণে সাহায্য করে।\n• সেন্ট্রোসোম: এটি প্রধানত প্রাণীকোষের বৈশিষ্ট্য। এটি কোষ বিভাজনের সময় স্পিন্ডল তন্তু তৈরিতে সাহায্য করে।\n• ২.২.৩ নিউক্লিয়াস: এটি কোষের প্রধান ও সর্বাপেক্ষা গুরুত্বপূর্ণ অঙ্গাণু, যা বংশগতির বৈশিষ্ট্য বহন করে ও কোষের সকল কার্যকলাপ নিয়ন্ত্রণ করে। এটি সাধারণত গোলাকার, ডিম্বাকার বা নলাকার হতে পারে।`,\n    32: `এই পৃষ্ঠায় নিউক্লিয়াস-এর গঠন নিয়ে বিস্তারিত আলোচনা করা হয়েছে। সুগঠিত নিউক্লিয়াসে সাধারণত চারটি অংশ দেখা যায়:\n• (a) নিউক্লিয়ার ঝিল্লি (Nuclear membrane): এটি দুই স্তরবিশিষ্ট ঝিল্লি যা নিউক্লিয়াসকে সাইটোপ্লাজম থেকে পৃথক রাখে।\n• (b) নিউক্লিওপ্লাজম (Nucleoplasm): নিউক্লিয়ার ঝিল্লির ভেতরে জেলির মতো থাকা বস্তু, যা নিউক্লিক অ্যাসিড, প্রোটিন, উৎসেচক ও খনিজ লবণ ধারণ করে।\n• (c) নিউক্লিওলাস (Nucleolus): এটি গোলাকার ঘন বস্তু, যা রাইবোসোম সংশ্লেষণে সাহায্য করে এবং নিউক্লিওপ্লাজমের সাথে সংযুক্ত থাকে।\n• (d) ক্রোমাটিন জালিকা (Chromatin reticulum): এটি কোষ বিভাজন না চললে সূক্ষ্ম সুতার মতো থাকে। ক্রোমাটিন হলো মূলত DNA ও প্রোটিনের সমন্বয়ে গঠিত জটিল কাঠামো, যা বংশগতীয় বৈশিষ্ট্য বহন করে।`,\n    33: `এই পৃষ্ঠায় ক্রোমাটিন জালিকা-র ধারাবাহিক আলোচনা এবং ২.৩ উদ্ভিদ ও প্রাণীর কাজ পরিচালনায় বিভিন্ন প্রকার কোষের ভূমিকা অংশের সূচনা করা হয়েছে।\n• ক্রোমাটিন জালিকা (continuation): কোষ বিভাজনের সময় ক্রোমাটিন জালিকাগুলো ঘনীভূত হয়ে সুগঠিত ক্রোমোজোমে পরিণত হয়। ক্রোমোজোম হলো বংশগতির ধারক ও বাহক।\n• একক কাজ: কোষের অঙ্গাণুগুলোর একটি শ্রেণিবিভাগ চার্ট তৈরি করতে বলা হয়েছে।\n• ২.৩ উদ্ভিদ ও প্রাণীর কাজ পরিচালনায় বিভিন্ন প্রকার কোষের ভূমিকা: এখানে বলা হয়েছে যে এককোষী প্রাণী (যেমন: প্রোটোজোয়া) ও বহুকোষী প্রাণীর কোষগুলো কীভাবে বিভিন্ন কাজ পরিচালনা করে। বহুকোষী জীবের দেহ গঠনে টিস্যু গুরুত্বপূর্ণ ভূমিকা রাখে।\n• ২.৩.১ উদ্ভিদ টিস্যু (Plant Tissue): এই অংশে টিস্যুর সংজ্ঞা দেওয়া হয়েছে।`,\n    34: `এই পৃষ্ঠায় উদ্ভিদ টিস্যু এবং এর প্রকারভেদ, বিশেষত সরল টিস্যু (Simple Tissue) নিয়ে আলোচনা করা হয়েছে।\n• উদ্ভিদ টিস্যু: এটি কোষ বিভাজনের ক্ষমতার ভিত্তিতে প্রধানত দুই প্রকার—ভাজক টিস্যু ও স্থায়ী টিস্যু। এখানে স্থায়ী টিস্যুর প্রকারভেদ নিয়ে আলোচনা শুরু হয়েছে।\n• সরল টিস্যু: যে টিস্যুর প্রতিটি কোষ আকার, আকৃতি ও গঠনের দিক থেকে একই রকম, তাকে সরল টিস্যু বলে। এরা তিন প্রকার:\n   ◦ প্যারেনকাইমা (Parenchyma): এদের কোষপ্রাচীর পাতলা ও সেলুলোজ নির্মিত। এদের প্রধান কাজ খাদ্য প্রস্তুত, খাদ্য সঞ্চয় ও পরিবহন। যদি এদের কোষে ক্লোরোপ্লাস্ট থাকে, তবে তাকে ক্লোরেনকাইমা (Chlorenchyma) বলে।\n   ◦ কোলেঙ্কিমা (Collenchyma): এদের কোষপ্রাচীর তুলনামূলকভাবে মোটা, বিশেষত কোণের দিকে পেকটিন জমা হয়। এদের কাজ উদ্ভিদকে দৃঢ়তা প্রদান।\n   ◦ স্ক্লেরেনকাইমা (Sclerenchyma): এদের কোষপ্রাচীর পুরু ও শক্ত, লিগনিন জমা হওয়ার কারণে কোষগুলো সাধারণত মৃত হয়। এদের কাজ উদ্ভিদকে দৃঢ়তা প্রদান।`,\n    35: `এই পৃষ্ঠায় স্ক্লেরেনকাইমা টিস্যু-এর বাকি অংশ এবং জটিল টিস্যু (Complex Tissues) নিয়ে আলোচনা শুরু হয়েছে।\n• স্ক্লেরেনকাইমা (continuation): এটি ফাইবার বা তন্তু (যা লম্বা, সরু ও দৃঢ়) এবং স্ক্লেরাইড বা স্টোন সেল (যা খাটো ও সমব্যাসীয়) এই দুই ধরনের হতে পারে।\n   ◦ ফাইবার বা তন্তু: এরা উদ্ভিদকে দৃঢ়তা ও খনিজ লবণ পরিবহনে সাহায্য করে।\n   ◦ স্ক্লেরাইড: এরা খাদ্য ও বীজত্বকে পাওয়া যায় এবং উদ্ভিদকে দৃঢ়তা দেয়।\n• একক কাজ: তিন ধরনের সরল টিস্যুর চিত্র আঁকতে বলা হয়েছে।\n• জটিল টিস্যু: বিভিন্ন ধরনের কোষের সমন্বয়ে গঠিত স্থায়ী টিস্যু, যা পরিবহন টিস্যু বা ভাস্কুলার বান্ডল গঠন করে। এরা দুই প্রকার—জাইলেম (Xylem) ও ফ্লোয়েম (Phloem)।\n   ◦ জাইলেম: এটি দুই ধরনের: প্রাথমিক ও গৌণ জাইলেম। এর প্রধান কাজ হলো পানি ও খনিজ লবণ পরিবহন করা।`\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./src/lib/explanations.ts\n");

